window.bookSummaryJSON = "<p>The War of the Gods has stalled while both sides recover, borders have been established, and a form of uneasy peace descends on the Imperial Territory of Dravith . . .</p> <p>It should be a time of consolidation, of rest and giving the survivors the chance to rearm and train.</p> <p>But life rarely goes as Jax expects.</p> <p>New and old enemies are on the horizon, the land itself is disturbed, and worst of all, the Gods are not all he believed they are . . .</p> <p>The Dark Tide Rises . . .</p>"; 
